            newplayers: 0,
            hotkeys: {...defaultHotkeys},
            helpSection: 0,
            voiceData: [100, 100, 100],
            alertsData: {},
            menuItems: 6,
            vipId: "Sapfire",
            vipEnd: 11111111111,
            ads: [
                {
                    title: "Покупай машины ограниченной серии",
                    text: "Управляй уникальным экземпляром каждый день",
                    pic: "car-slider",
                    button: "поставить метку автосалона",
                    pos: {x: 1, y: 1, z: 1},
                },
                {
                    title: "Покупай машины ограниченной серии",
                    text: "Управляй уникальным экземпляром каждый день",
                    pic: "car-slider-2",
                    button: "поставить метку автосалона",
                    pos: {x: 1, y: 1, z: 1},
                },
                {
                    title: "Покупай машины ограниченной серии",
                    text: "Управляй уникальным экземпляром каждый день",
                    pic: "car-slider-3",
                    button: "поставить метку автосалона",
                    pos: {x: 1, y: 1, z: 1},
                },
                {
                    title: "Покупай машины ограниченной серии",
                    text: "Управляй уникальным экземпляром каждый день",
                    pic: "car-slider-4",
                    button: "поставить метку автосалона",
                    pos: {x: 1, y: 1, z: 1},
                },
            ],
            curAd: 0,
            shopPay: null,
            shopPage: 0,
            donate: 9999,
            buyVip: 0,
            buyVipTime: 0,
            buyCoin: 0,
            buyName: "",
            buyModal: 0,
            showPass: [false, false, false],
            passData: ["", "", ""],
            google: false,
            googleInput: "",
            promo: "",
            ask: {
                select: null,
                filter: [false, false],
                id: CEF.id,
                items: [],
                // messages: [
                //     {id: 1, time: 12345, name:"Test Name", text: "Привет привет привет привет пакет"},
                //     {id: 2, time: 12345, name:"Test Name2", text: "Привет привет привет привет пакет"},
                //     {id: 1, time: 12345, name:"Test Name", text: "Привет привет привет привет пакет"},
                //     {id: 4, time: 12345, name:"Test Name4", text: "Привет привет привет привет пакет"},
                //     {id: 1, time: 12345, name:"Test Name", text: "Привет привет привет привет пакет"},
                //     {id: 1, time: 12345, name:"Test Name", text: "Привет привет привет привет пакет"}
                // ],
                input: "",
            },
            bankNumber: 123456,
            bankPos: {x: 0, y: 0},
            donateX: false,
            donateX3: false,
            chatSort: [false, false],
            playersType: 0,
            bonus: 265,
            carbonus: 100,
        };
        this.ev = CustomEvent.register(
            "mainmenu:data",
            (
                rp_name: string,
                food: number,
                water: number,
                man: boolean,
                exp: number,
                level: number,
                wanted_level: number,
                wanted_reason: string,
                warns: number,
                bans: number,
                work: JobId,
                fraction: string,
                rank: string,
                house: string,
                business: string,
                players: [number, string, number][],
                hotkeys: {
                    [task: string]: number;
                },
                voiceData: [number, number, number],
                menuItems: number,
                ads: {
                    title: string;
                    text: string;
                    pic: string;
                    button: string;
                    pos: {
                        x: number;
                        y: number;
                        z: number;
                    };
                }[],
                vipId: VipId,
                vipEnd: number,
                donate_money: number,
                donateShops: any,
                bankNumber: number,
                bankPos: any,
                donateX,
                donateX3,
                online,
                total,
                bonus,
                alertsData: StorageAlertData,
                carbonus,
                achieve,
                achieveDaily,
                promocodeMy,
                promocodeMyCount,
                promocodeMyRewardGived,
                usersVoice,
                voiceLevel,
                lodDistPlayers,
                lodDistVehs,
                boomboxSound,
                report
            ) => {
                this.setState(
                    {
                        achieve,
                        achieveDaily,
                        donateX,
                        donateX3,
                        bankPos,
                        bankNumber,
                        donateShops,
                        loaded: true,
                        rp_name,
                        food,
                        water,
                        man,
                        exp,
                        level,
                        wanted_level,
                        wanted_reason,
                        warns,
                        bans,
                        work,
                        fraction,
                        rank,
                        house,
                        business,
                        players,
                        hotkeys,
                        voiceData,
                        menuItems,
                        ads,
                        vipId,
                        vipEnd,
                        donate: donate_money,
                        online,
                        total,
                        bonus,
                        alertsData,
                        carbonus,
                        promocodeMy,
                        promocodeMyCount,
                        promocodeMyRewardGived,
                        usersVoice,
                        voiceLevel,
                        lodDistPlayers,
                        lodDistVehs,
                        boomboxSound,
                    },
                    () => {
                        if (report) {
                            this.setPage("ticket");
                        }
                    }
                );
