                                                    <div className="input-term-item">
                                                        <input
                                                            type="radio"
                                                            id="term1"
                                                            name="rate"
                                                            className={`rates-item active`}
                                                            onClick={() =>
                                                                this.setState({...this.state, buyVipTime: 1})
                                                            }
                                                            checked={
                                                                this.state.buyVipTime === 1 ? true : false
                                                            }
                                                            readOnly
                                                        />
                                                        <label htmlFor="term1">
